import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import './footer.css';

const Foot=()=>{
return(
    <Fragment>
        <div className="foot_container">
            <div className="services">
                <div className="service_head">Services</div>
                <ul >
                    <li className="list_service">Web Design</li>
                    <li className="list_service">Web Development</li>
                    <li className="list_service">Website Maintenance</li>
                </ul>
            </div>
            <div className="copyrights"><p>&copy;2022 Copyrights Reserved-Created by Priyansh Gupta. </p>
            </div>
            <div className="Arrow_up"><span className="icon"><ion-icon className="icon"name="chevron-up-circle-outline"></ion-icon></span></div>
        </div>
    </Fragment>
    );
};

export default Foot;
